/** @format */

import { NavLink } from "react-router-dom";

const Nav = ({ names }) => {
  return (
    <nav>
      <NavLink exact to="/dogs">
        Home
      </NavLink>
      {names.map((n) => {
        <NavLink exact to={`/dogs/${n}`}>
          {n}
        </NavLink>;
      })}
    </nav>
  );
};

export default Nav;
